import Todo from './../models/todo'

const Todos: React.FC<{Todos: Todo[]}> = (props) => {
	return (
		<ul>
			{props.Todos.map(todo => <li key={todo.id}>{todo}</li>)}
		</ul>
	);
}

export default Todos;
